const filterProps = (props) => {
    const propsNew = {};
    const keys = Object.keys(props);
    for (const key of keys) {
        if (props[key] !== undefined) {
            propsNew[key] = props[key];
        }
    }
    return propsNew;
};
export { filterProps };
